    true,nt"url": null,nt"notes": "USDA cooking yields data for meat and poultry,
    provided in electronic format for the first time, include updates to information
    which was previously printed in the USDA Agriculture Handbook No. 102 Food Yields
    (AH-102) in 1975. Data in the updated table, accessible below, are measures of changes
    in meat and poultry weights resulting from moisture and fat losses during cooking.
    The table includes percentages for cooking yield, moisture change, and fat change
    for specific cuts of meat and poultry prepared in USDA research studies according
